import React from 'react';
import axios from 'axios';

export default function TopPosts() {
  const [posts, setPosts] = React.useState([]);
  React.useEffect(()=>{ (async ()=>{ try { const r = await axios.get('/posts/top10'); setPosts(r.data); } catch(e){ setPosts([]);} })(); }, []);
  return (
    <div className="border p-2 mb-2">
      <h2>Top Posts</h2>
      <ul>
        {posts.map(p => <li key={p.post_id}>{p.post_id} by {p.user_id} — {p.likes} likes — {p.content}</li>)}
      </ul>
    </div>
  );
}
